import React from 'react';
import Header from './components/Header/Header';
import {Router,Link,Route,Switch} from 'react-router-dom';
function App() {
  return (
        <div className="App">
        <Header>
          NAVBAR
          <Link to='/'>Home</Link>
          <Link to='/product'>Product</Link>
          <Link to='/company'>Company</Link>
        </Header>

        <Route exact path='/'>
         HOME PAGE 
        </Route>

        <Route path='/product'>
          PRODUCT PAGE 
        </Route>

        <Route path='/company'>
          COMPANY PAGE
        </Route>
    </div>
  );
}

export default App;
